import Vue from 'vue'
import VuRouter from 'vue-router'
import viewHome from '../views/Home/index.vue'
import viewUser from '../views/User/index.vue'
import viewLogin from '../views/Login/index.vue'

Vue.use(VuRouter)

const routes =[
    {
        path:'/',
        component:()=>import("../views/Login/index.vue"),
    },
    {
        path:'/login',
        name:'Login',
        component:()=>import("../views/Login/index.vue"),
    },
    {
        path:'/fail',
        component:()=>import("../views/Login/fail.vue"),
        hiddem:true
    },
    {
        path:'/home',
        name:'Home',
        component:()=>import("../views/Home/index.vue"),
        children:[
            {
                path:'notice',
                name:'notice',
                component:()=>import("../views/Home/notice.vue"),
            },
            {
                path:'upPost',
                name:'upPost',
                component:()=>import("../views/Home/upPost.vue"),
            },
            {
                path:'test',
                name:'test',
                component:()=>import("../views/Home/upPost.vue"),
            }
        ]
    },
    {
        path:'/user',
        name:'User',
        component:viewUser,
        children:[
            {
                path:'basicInfo',
                name:'basicInfo',
                component:()=>import("../views/User/basicInfo")
            },
            {
                path:'noticeList',
                name:'noticeList',
                component:()=>import("../views/User/noticeList")
            },
            {
                path:'subscribeList',
                name:'subscribeList',
                component:()=>import("../views/User/subcribeList")
            },
            {
                path:'fanList',
                name:'fanList',
                component:()=>import("../views/User/fanList")
            }
        ]
    }
]

const router = new VuRouter({
    mode:'history',
    scrollBehavior: () => ({ y: 0 }),
    routes
})

export default router
